        for (int i = 0; i < nTaxa; i++) {
            if (nCodon >= MAX_CODONS) {
                xml.append(seqs[i]);
            } else {
                // chop sites to nCodon
                String key = "value=";
                int idVal = seqs[i].indexOf(key);
                // from value=" to "/>
                String s = seqs[i].substring(idVal + key.length() + 1, seqs[i].length()-3);
                assert s.length() == MAX_CODONS * 3; // original
                // length = nCodon * 3
                s = s.substring(0, nCodon*3);
                // before and include value="
                String tmp = seqs[i].substring(0, idVal + key.length() + 1);
                tmp += s + "\"/>";
                xml.append(tmp);
            }
        }

        xml.append("</data>\n").append("</beast>\n");

        XMLParser parser = new XMLParser();
        Alignment alignment = (Alignment) parser.parseBareFragment(xml.toString(), true);
        return alignment;
